Last year while I was suffering from severe postpartum hairfall and dry frizzy hair, I discovered some amazing hair oils that cater to some very common hair concerns

Here’s what I found - 

@thetribeconcepts 90 day miracle hair oil is a blend of Ayurvedic oils that nourished my scalp and I saw a visible difference in hairfall after the 4the week mark 

@kamaayurveda Bringadi oil is a great overnight treatment for premature greying and dandruff. It’s not a quick fix, showed results in 3-4 weeks

@indulekhaoil the oil claims to control hairfall, I’ve used a few bottles of this. Didn’t control hairfall for me but an excellent option for hair regrowth. Starting seeing results after 4 weeks

#notsponsored #hairfall #hairfallcontrol #haircare #haircareproducts #indianhaircare #hairgrowth

5 Moisturisers for Oily/Acne Prone Skin. What are your favourite moisturisers? Let me know in comments👇

@plumgoodness Green Tea Moisturiser is a lightweight yet hydrating formula. I like the pump packaging to dispense just the right amount and it’s at a good price point 

@suganda.co White Lotus Moisturiser is an oil free gel based formula with second ingredient as Niacinamide this is a very intelligently formulated product. This is perfect if you have inflamed skin due to acne 

Hyalu Hyaluronic acid gel is a simple yet effective moisturiser and will suit most skin types. I love how affordable this is and super duper hydrating 

@sebamedindia Clear Face Care gel is a one of a kind formulation which is perfect for inflamed irritated skin 

Excela is tailor made for oily acne prone skin especially for winters. Again the second ingredient is Niacinamide here and I also love the air-less pump packaging which increases the shelf life of the product 

